import React from "react";
import {slide as Menu} from "react-burger-menu";

 class menuClass extends react.Component {
     render(){
    return (
        // Pass on our props
        <Menu {...props}>

            {props.userStatus !== 1 ? <a className="menu-item" href="./NavigateTheChief.js">
                    Ana Ekran
                </a>
                :

                <a className="menu-item" href="./PersonelNavigation.js">
                    Ana Ekran
                </a>
            }

            {
                props.userStatus !== 1 &&
                <a className="menu-item" href="./PreviousPermissions.js">
                    Personel İzin Talepleri
                </a>
            }
            <a className="menu-item" href={'/PersonelScreens/FillingThePermissionForm'}>
                İzin Yaratma Ekranı
            </a>

            <a className="menu-item" href="./PreviousPermissions.js">
                İzinlerimi Göster
            </a>
        </Menu>)
     }
}
